import React, { Component } from 'react';


import Head from 'next/head';

class InfoBlocks extends Component {

    constructor(props) {
        super(props);
        this.state = {
            infoBlock: ''
        }
    }

    UNSAFE_componentWillMount() {
        this.setInfoBlocks();
    }

    setInfoBlocks = () => {
        this.setState({ infoBlock: this.props.InfoObj });
    }

    getConnects = () => {
        let data = this.state.infoBlock.connects;
        return (
            <div className="container">
                <div className="img">
                    <img src={data.image} alt="Image Description" />
                </div>
                <div className="textblock">
                    <div className="holder">
                        <h2>{data.heading}</h2>
                        <p>{data.paragraph}</p>
                        <ul className="info-list">
                            {data.lists.map((datas, index)=>{
                                return(
                                    <li key={index}>{datas.list}</li>
                                )
                            })}
                        </ul>
                        <a className="more">{data.learnMore}</a>
                    </div>
                </div>
            </div>
        )
    }

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="info-blocks">               
                    {this.getConnects()}
                    <div className="container">
                        <div className="img">
                            <img src="images/img48.png" alt="Image Description" />
                        </div>
                        <div className="textblock">
                            <div className="holder">
                                <h2>Treat Your Patients</h2>
                                <p>Lightening-fast EMR makes fully compliant documentation, before and after photography, procedure tracking and checkout accurate & efficient</p>
                                <ul className="info-list">
                                    <li>Complete EMR Solution</li>
                                    <li>Mobile Point-of-Sale</li>
                                    <li>Before & After Photos</li>
                                    <li>Patient Wallet, Memberships & Subscription Plans</li>
                                    <li>HIPAA - Compliant TeleHealth Platform</li>
                                </ul>
                                <a href="#" className="more">Learn more</a>
                            </div>
                        </div>
                    </div>
                    <div className="container">
                        <div className="img">
                            <img src="images/img49.png" alt="Image Description" />
                        </div>
                        <div className="textblock">
                            <div className="holder">
                                <h2>Manage The Clinic</h2>
                                <p>Advanced reporting, reputation management, commission tracking and inventory controls lead to better decision making and smooth operations</p>
                                <ul className="info-list">
                                    <li>Business Insights</li>
                                    <li>Supply Chain Management</li>
                                    <li>Employee Performance Tracking</li>
                                </ul>
                                <a href="#" className="more">Learn more</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default InfoBlocks;
